  [],\n\t\"revision_timestamp\": \"2015-05-06T20:56:16.556749\",\n\t\"name\": \"low-cost-low-noise-variable-pitch-ducted-fan-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"ACI proposes a design for a Propulsor (Low
  Cost/Low Noise Variable PitchnDucted Fan) that has wide application in all sectors
  of Aviation.nPropulsor hardware of this low cost design can be integrated with anbroad
  range of aircraft engines (e.g. existing piston engines,nautomotive derivative piston
  engines, new design turbine engines) fornuse in new design aircraft.   The proposed
  Propulsor design willnincorporate known acoustic design features that support low
  noisenaircraft operation.  These features include the use of duct acousticnliners,
  attenuating harmonic stator vane and rotor blade configurations,nand duct designs
  that direct/condition the exhaust air stream tonminimize noise heard by individuals
  on the ground during aircraftntakeoff, landing, and fly-over.   The proposed Propulsor
  design makesnpossible the fabrication of low cost and low weight variable pitch
  fannblades and rotors.  The new composite blade/retention design avoids thenneed
  for heavy and expensive ball bearings and other complex hub pitchnchange mechanism
  components.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
